import styled from 'styled-components';

export const ButtonWrapper = styled.button`
    margin-top: 140px;  
    justifyContent: 'center'
`

export const Item = styled.div`
    overflow: auto;
    padding: 20px 0;
    margin-top: 140px;
    .pic {
        display: block;
        width: 150px;
        height: 120px;
        border-radius: 10px;
        border-style: solid;
        margin-left: auto;
        margin-right: auto;    
    }
`
